import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function MyButton() {
  const [count, setCount] = useState(0);
  function handleClick() {
    setCount(count+1);
  }
  return (
    <>
    <button onClick={handleClick}>I'm a button</button>
    <p>Big man clicked {count} times</p>
    </>

  );
}

function LoginPage(){

  return(
        <div class="App">
          <header>
            <h1>Login Page</h1>
          </header>

            <body className='Boxe'>
              <input>Username</input>
              <input>Password</input>
              <button className='Butt'>
                Log me in
              </button>
            </body>
        </div>

  );
}

function Testing(){
  return(
    <>
    <p>This is where I begin my villain monologue.</p>
    <h1>But <br /> nahhh</h1>
    </>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <body className="App-Testing">
        <p>HELLO</p>
        <MyButton />
        <Testing />
        <LoginPage />
      </body>
    </div>
  );
}

export default App;
